import React, { useEffect, useState } from "react";
import axios from "axios";

const Shop = () => {
  const [Data, setData] = useState([]);

  useEffect(() => {
    axios.get("https://dummyjson.com/carts")
    .then((res) => {
        setData(res.data)
    })
  }, []);

  console.log(Data);

  return <div>Shop</div>;
};
export default Shop;
